import GlobleContext from "./GlobleContext";

const [options, setOptions] = useState([]); // for zone option create a state

const fetchData = async () => {
  try {
    const response = await axios.get(
      "https://railwaymcq.com/ohe/zone_division_api.php"
    );
    setOptions(response.data);
  } catch (error) {
    console.error("Error fetching options:", error);
  }
};
const GlobleState = (props) => {
  const state = {
    name: "om",
    class: "MCA",
  };

  return (
    <GlobleContext.Provider value={fetchData}>
      {props.children}
    </GlobleContext.Provider>
  );
};

export default GlobleState;
